webpackJsonp([0x646d394981fa],{3086:function(e,n){e.exports={data:{markdownRemark:{html:'<p><strong>(Apr. 10, 2008) Operation support of old version terminated</strong></p>\n<p>From today, I ended any support before v0.1i. If you are using support target FLAN, we recommend that you upgrade early.</p>\n<h2>(2006/10/23) About specification change of v0.2c</h2>\n<p>As the script producer has the following changes, familiarize yourself and upgrade the version as much as possible.</p>\n<ul>\n<li>_ Member variable m <em>nFlanStageCount</em> storing the number of frames since the start of the stage <em>has been discontinued.</em></li>\n</ul>\n<p><strong>(2006/10/9) About specification change of v0.2a</strong></p>\n<p>As the script producer has the following changes, familiarize yourself and upgrade the version as much as possible.</p>\n<ul>\n<li>Changed _FLAN_ESS_ARGV_DEFAULT to FLAN_ENEMY_ARGV <em>DEFAULT and can not be used from bullet scripts.</em></li>\n<li>_FLAN_ENEMY_ITEM_WIDTH has been <em>renamed</em> FLAN<em>ITEM _WIDTH.</em></li>\n<li><em>The argument of CreateStack increased by one.</em></li>\n</ul>\n<p><strong>(August 27, 2006) Change installation folder</strong></p>\n<p>Since v0.1 g, the installation folder has been changed from "th_dnh / FLAN" to "th_dnh / lib / FLAN" as before.</p>',frontmatter:{cover:null,date:"2006-07-21T00:00:58+09:00",strDate:"2006/7/20",title:"Announcement"}}},pathContext:{path:"/en/blog/2006/07/21-告知/",langKey:"en"}}}});
